import {
  AppBar,
  Toolbar,
  Button,
  Typography,
  makeStyles,
  Grid,
} from "@material-ui/core";

const useStyles = makeStyles((theme) => ({
  title: {
    flexGrow: 1,
  },
}));

const Header = () => {
  const classes = useStyles();

  return (
    <AppBar position="sticky">
      <Toolbar>
        <Grid container>
          <Grid item lg={1}></Grid>

          <Grid item lg={6}>
            <Typography variant="h6" className={classes.title}>
              Tracthon
            </Typography>
          </Grid>

          <Grid item lg={6}>
            <Button edge="end" color="inherit">
              Login
            </Button>
          </Grid>

          <Grid item lg={1}></Grid>
        </Grid>
      </Toolbar>
    </AppBar>
  );
};

export default Header;
